n = -10:10;
unitstep1 = n>=0;
unitstep2 = n>=6;
x = unitstep1 - unitstep2;
subplot(2,2,1)
stem(n, x)
xlabel('time');
ylabel('Amplitude');
title('Input function')
legend('Aditya 102106179')

h = unitstep1 - unitstep2;
subplot(2,2,2)
stem(n, h)
xlabel('time');
ylabel('Amplitude');
title('Impulse function')

a = length(x);
b = length(h);
N = a+b-1;

X = [x, zeros(1,N-a)];
H = [h, zeros(1,N-b)];

for n = 1:N
    y(n) = 0;
    for k = 1:a

        if(k <= n)
            y(n) = y(n) + X(k)*H(n-k+1);
        end
    end
end
